local CAM_SPEED=0.05
function lerp(a,b,t) return (1-t)*a + t*b end

function init()
 t=0
 p={x=32,y=32,s=256}
 cam={x=120,y=68}
end

init()
function TIC()
 cam.x=math.min(120,lerp(cam.x,120-p.x,CAM_SPEED))
	cam.y=math.min(64,lerp(cam.y,64-p.y,CAM_SPEED))
	local ccx=cam.x/8+(cam.x%8==0 and 1 or 0)
	local ccy=cam.y/8+(cam.y%8==0 and 1 or 0)

	map(15-ccx,8-ccy,31,18,(cam.x%8)-8,(cam.y%8)-8)
	
	if btn(0) then p.y=p.y-1 end
	if btn(1) then p.y=p.y+1 end
	if btn(2) then p.x=p.x-1 end
	if btn(3) then p.x=p.x+1 end
	
	spr(p.s,p.x+cam.x,p.y+cam.y,0)
	--spr(p.spr,p.x,p.y)
	
	rect(cam.x-120+8,cam.y-64+8,8,8,2)

	line(0,68,240,68,15)
	line(120,0,120,136,15)
	
end

